# This is count DigitOne Function
# It counts the number of occurrences of the numerical digit, 1.
def outside_class_function(n):
    count = 0
    for i in range(1, n+1):
            num = str(i)
            for j in num:
                if int(j) == 1:
                    count += 1
    return count
